import React, { useState, useEffect } from "react";
import "./App.css";
import Form from "./components/Form";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Posts from "./Posts";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Posts />
        </Route>
        <Route exact path="/create">
          <Form />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
